import React, { useState } from "react";
import './project.css';
import Content from "./Content";
import Main from "./pr/Main";
import img1 from '../../images/Pr-1.png';
import img2 from '../../images/Pr-2.png';
import img3 from '../../images/Pr-3.png';
import img4 from '../../images/Pr-4.png';
import img5 from '../../images/Pr-5.png';
import img6 from '../../images/Pr-6.png';
export default function Projects(){
    const skill=["HTML|CSS|JS","React","Node|MDB"];
    const front1=["Typing-Test","Love Calculator","Random Quotes"];
    const react=["Basic Calculator","Notes App"];
    const back=["Wheather App","App in production!"];

    return(
        <>
            <div className="project">
                <div className="layer1">My Projects</div>
                <div className="layer2">
                    {skill.map((val,i)=>{
                        if(i === 0)
                        {
                            return(
                                <>
                                <Content cl={true} text={val} id={i}/>
                                </>
                            )
                        }
                        else{
                            return(
                                <>
                                <Content cl={false} text={val} id={i}/>
                                </>
                            )
                        }
                    })}
                    <div className="hire">
                        Hire Me !
                    </div>
                </div>
                <div className="layer3">
                    <div className="item1" id="item1">
                        <Main text={front1[0]} image={img1} />
                        <Main text={front1[1]} image={img2} />
                        <Main text={front1[2]} image={img3} />
                    </div>
                    <div className="item2" id="item2">
                        <Main text={react[0]} image={img4} />
                        <Main text={react[1]} image={img5} />
                    </div>
                    <div className="item3" id="item3">
                        <Main text={back[0]} image={img6} />
                        <Main text={back[1]}  />
                    </div>
                </div>
                <div className="layer4">
                    <h4>These are some of the Random Selected Projects for more such projects visit my GitHUB</h4>
                  <button>GitHub</button>
                </div>
            </div>
        </>
    );
}
